import React from "react";
import styled from "styled-components";

const HeaderContainer = styled.header`
  background-color: #3b3b3b;
  color: white;
  padding: 20px;
  text-align: center;
`;

const Header = () => {
  return (
    <HeaderContainer>
      <h1>My Application</h1>
    </HeaderContainer>
  );
};

export default Header;
